INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5410355419122', 'Bulgur vegetale', 'Boulghour (eau, boulghour (contient gluten)) 23%, épinards en branches 14%, orge 9%, tomate cerise 9%, petits pois 8%, pois croquants 8% haricots verts 7%, blé 6%, eau, tomates confites (tomate, sucre, sel) 3%, graines de tournesol, huile d\'olive, sel, pignons de pin, ciboulette, persil, citronnelle, épices amidon de riz, huile de colza. Conservation: Dans le congélateur (-180c maximum). Ne jamais recongeler un produit décongelé. Préparation: poêle : Verser directement le produit encore surgelé dans la poêle. Faire revenir environ 7 à 8 minutes à feu moyen en remuant de temps en temps. Four à micro-ondes (750W): Mettre la quantité désirée dans un plat adapté aux micro-ondes avec couvercle. Pour 500g, chauffer 10 minutes à puissance maximale. Attendre 2 minutes avant de servir. Une préparation à la poêle donne le meilleur résultat.', 'https://static.openfoodfacts.org/images/products/541/035/541/9122/front_fr.4.400.jpg', '3.8', '0.5', '13', '0.9', '', '4', '0.61', '0.240157480314961', '', '1');

