VALUES ('5410473042905', 'Thon piquant', 'Morceaux de thon en saumure 42% (thon (katsuwonus pelamis) 36%&quot;, eau, sel, extraits végétaux), huile de colza, eau, concentré de tomate, jaune d\'_œuf_, sirop de sucre inverti, _moutarde_ forte (eau, graines de moutarde, vinaigre, sel, curcuma), préparation d\'épices (farine de _blé_, sel, épices (paprika, poivre), basilic, poudre d\'oignon, poudre d\'ail, antiagglomérant: E551), poudre de tomate, mélange d\'épices (amidon modifié de mais, sel, conservateurs:E202, E211, herbes et épices (origan, muscade, poivre de Cayenne, marjolaine), épaississant E412, E415, sel, dextrose, extrait de levure, poudre d\'ail, extrait de fines herbes), vinaigre, préparation au piment 1% (piments rouges moulus 0,8% dont 0,06% de purée de piment, sel, régulateur d\'acidité: E260, conservateur: E211), amidon modifié de mais, colorant: E160c, épaississants:E412, E415, flocons de pomme de tere (pomme de terre, émulsifiant: E471, stabilisant: E450, antioxydant: E304).', 'https://static.openfoodfacts.org/images/products/541/047/304/2905/front_fr.4.400.jpg', '37.1', '2.2', '6.3', '3.1', '', '11', '2', '0.78740157480315', '', '0');

